_5":"","created_at":"2022-02-22T23:58:32.000000Z","updated_at":"2022-02-22T23:58:32.000000Z"},{"id":138,"group_question_id":54,"list_question_id":17,"question":"______ in several early civilizations, a cubit was based on the length of the forearm from the tip of the middle finger to the elbow.","option_1":"It was used as a measurement","option_2":"A measurement was used","option_3":"The use of a measurement","option_4":"Used as a measurement","option_5":"","created_at":"2022-02-22T23:58:32.000000Z","updated_at":"2022-02-22T23:58:32.000000Z"},{"id":139,"group_question_id":54,"list_question_id":17,"question":"Only when air and water seep through its outer coat ______.","option_1":"does a seed germinate","option_2":"to the germination of a seed","option_3":"a seed germinates","option_4":"for a seed to germinate","option_5":"","created_at":"2022-02-22T23:58:32.000000Z","updated_at":"2022-02-22T23:58:32.000000Z"},{"id":140,"group_question_id":54,"list_question_id":17,"question":"______ seasonal rainfall. especially in regions near the tropics, is winds that blow in an opposite direction in winter than in summer.","option_1":"Causing","option_2":"That cause","option_3":"To cause","option_4":"What causes","option_5":"","created_at":"2022-02-22T23:58:32.000000Z","updated_at":"2022-02-22T23:58:32.000000Z"},{"id":141,"group_question_id":54,"list_question_id":17,"question":"The extinct Martian volcano Olympus Mons is approximately three times as ______ Mount Everest.","option_1":"high","option_2":"high as is","option_3":"higher than","option_4":"the highest of","option_5":"","created_at":"2022-02-22T23:58:32.000000Z","updated_at":"2022-02-22T23:58:32.000000Z"},{"id":142,"group_question_id":54,"list_question_id":17,"question":"The flight instructor, ______ at the air base, said that orders not to fight had been given.","option_1":"when interviewed","option_2":"when he interviewed","option_3":"when his interview","option_4":"when interviewing","option_5":"","created_at":"2022-02-22T23:58:32.000000Z","updated_at":"2022-02-22T23:58:32.000000Z"},{"id":143,"group_question_id":54,"list_question_id":17,"question":"In the northern and central parts of the state of Idaho ______ and churning rivers.","option_1":"majestic mountains are found","option_2":"found majestic mountains","option_3":"are found majestic mountains","option_4":"finding majestic mountains","option_5":"","created_at":"2022-02-22T23:58:32.000000Z","updated_at":"2022-02-22T23:58:32.000000Z"}]}]}}
