 involved in a mercantile business, a lumber and grist mill, a taxidermy business, and a school. His general <strong>mode (A2) <\/strong>of operating a business was to leave it either unattended or in the hands of a partner and take off on excursions through the wilds to paint the natural life that he saw. His business career came to an end in 1819 when he was jailed for debt and forced to file for bankruptcy.<\/p><p><br>It was at that time that Audubon began to seriously <strong>pursue (A3) <\/strong>the dream of publishing a collection of his paintings of birds. For the next six years he painted birds in their natural habitats while his wife worked as a teacher to <strong>support (A4) <\/strong>the family. His Birds of America, which included engravings of 435 of his colorful and lifelike watercolors, was published in parts during the period from 1826 to 1838 in England. After the success of the English editions, American editions of his work were published in 1839, and his fame and fortune were ensured.<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:40:48.000000Z","sequence_exam":[{"id_exam":172,"sequence":4},{"id_exam":173,"sequence":5},{"id_exam":174,"sequence":6}],"question":[{"id":172,"group_question_id":57,"list_question_id":19,"question":"<p>The word \"mode\" <strong>(A2)<\/strong> could best be replaced by<\/p>","option_1":"method","option_2":"vogue","option_3":"average","option_4":"trend","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T22:36:47.000000Z"},{"id":173,"group_question_id":57,"list_question_id":19,"question":"Audubon decided not to continue to pursue business when","option_1":"he was injured in an accident at a grist mill","option_2":"he decided to study art in France","option_3":"he was put in prison because he owed money","option_4":"he made enough money from his paintings","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":174,"group_question_id":57,"list_question_id":19,"question":"<p>The word \"pursue\" <strong>(A3)<\/strong> is closest in meaning to<\/p>","option_1":"imagine","option_2":"share","option_3":"follow","option_4":"deny","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T22:37:18.000000Z"}]},{"id":58,"list_question_id":19,"name":"R1C","description":"Question 1-9","filename_group":"","question_group":"<p>John James Audubon, nineteenth-century artist and naturalist, is known as one of the <strong>foremost<\/strong><i><strong> <\/strong><\/i><strong>(A1) <\/strong>authorities on North American birds. Born in Les Cayes, Haiti, in 1785, Audubon was raised in France and studied art under French artist Jacques-Louis David. After settling on his father's Pennsylvania estate at the age of eighteen, he first began to study and paint birds.<\/p><p><br>In his young adulthood, Audubon undertook numerous enterprises, generally without a tremendous amount of success; at various times during his life he was involved in a mercantile business, a lumber and grist mill, a taxidermy business, and a school. His general <strong>mode (A2) <\/strong>of operating a business was to leave it either unattended or in the hands of a partner and take off on excursions through the wilds to paint the natural life that he saw. His business career came to an end in 1819 when he was jailed for debt and forced to file for bankruptcy.<\/p><p><br>It was at that time that Audubon began to seriously <strong>pursue (A3) <\/strong>the dream of publishing a collection of his paintings of birds. For the next six years he painted birds in their natural habitats while his wife worked as a teacher to <strong>support (A4) <\/strong>the family. His Birds of America, which included engravings of 435 of his colorful and lifelike watercolors, was published in parts during the period from 1826 to 1838 in England. After the success of the English editions, American editions of his work were published in 1839, and his fame and fortune were ensured.<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:41:22.000000Z","sequence_exam":[{"id_exam":175,"sequence":7},{"id_exam":176,"sequence":8},{"id_exam":177,"sequence":9}],"question":[{"id":175,"group_question_id":58,"list_question_id":19,"question":"According to the passage, Audubon's paintings.","option_1":"were realistic portrayals","option_2":"used only black, white. and gray","option_3":"were done in oils","option_4":"depicted birds in cages","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":176,"group_question_id":58,"list_question_id":19,"question":"<p>The word \"support\" <strong>(A4)<\/strong> could best be replaced by<\/p>","option_1":"tolerate","option_2":"provide for","option_3":"side with","option_4":"fight for","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T22:38:30.000000Z"},{"id":177,"group_question_id":58,"list_question_id":19,"question":"It can be inferred from the passage that after 1839 Audubon","option_1":"unsuccessfully tried to develop new businesses","option_2":"continued to be supported by his wife","option_3":"traveled to Europe","option_4":"became wealthy","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"}]},{"id":59,"list_question_id":19,"name":"R2A","description":"Question 10-19","filename_group":"","question_group":"<p>These stories of killer bees in the news in recent years have attracted a lot of attention as the bees have made their way from South America to North America. Killer bees are reputed to be extremely aggressive in nature, although experts say that their aggression may have been somewhat <strong>inflated (B1)<\/strong>.<\/p><p><br>The killer bee is a <strong>hybrid (B2) <\/strong>\u2013 or combination \u2013 of the very mild European strain of honeybee and the considerably more aggressive African bee, which was created when the African strain was imported into Brazil in 1955. The African bees were brought into Brazil because their aggression was considered an advantage: they were far more productive than their European counterparts in that they spent a higher percentage of their time working and continued working longer in inclement weather than did the European bees.<\/p><p><br>These killer bees have been known to attack humans and animals, and some fatalities have occurred. Experts point out, however, that the mixed breed known as the killer bee is actually not at all as aggressive as the pure African bee. <strong>They (B3) <\/strong>also point out that the attacks have a chemical cause. A killer bee stings only when it has been disturbed; it is not aggressive by nature'. However, after a disturbed bee stings and flies away, it leaves its stinger embedded in the victim. In the vicera attached to the embedded stinger is the chemical isoamyl acetate, which has an odor that attracts other bees. As other bees approach the victim of the original sting, the victim tends to panic, thus disturbing other bees and causing them to sting. The new stings create more of the chemical isoamyl acetate, which attracts more bees and increases the panic level of the victim. Killer bees tend to travel in large clusters or swarms and thus respond in large numbers to the production of isoamyl acetate<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T14:10:24.000000Z","sequence_exam":[{"id_exam":178,"sequence":10},{"id_exam":179,"sequence":11},{"id_exam":180,"sequence":12}],"question":[{"id":178,"group_question_id":59,"list_question_id":19,"question":"The subject of the preceding paragraph was most likely","option_1":"ways of producing honey","option_2":"stories in the media about killer bees","option_3":"the chemical nature of killer bee attacks","option_4":"the creation of the killer bee","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":179,"group_question_id":59,"list_question_id":19,"question":"The main idea of this passage is that killer bees","option_1":"have been in the news a lot recently","option_2":"have been moving unexpectedly rapidly through the Americas","option_3":"are not as aggressive as their reputation suggests","option_4":"are a hybrid rather than a pure breed","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":180,"group_question_id":59,"list_question_id":19,"question":"<p>The word \"inflated\" <strong>(B1)<\/strong> could best be replaced by<\/p>","option_1":"exaggerated","option_2":"blown","option_3":"aired","option_4":"burst","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T23:02:48.000000Z"}]},{"id":60,"list_question_id":19,"name":"R2B","description":"Questions 10-19","filename_group":"","question_group":"<p>These stories of killer bees in the news in recent years have attracted a lot of attention as the bees have made their way from South America to North America. Killer bees are reputed to be extremely aggressive in nature, although experts say that their aggression may have been somewhat <strong>inflated (B1)<\/strong>.<\/p><p><br>The killer bee is a <strong>hybrid (B2) <\/strong>\u2013 or combination \u2013 of the very mild European strain of honeybee and the considerably more aggressive African bee, which was created when the African strain was imported into Brazil in 1955. The African bees were brought into Brazil because their aggression was considered an advantage: they were far more productive than their European counterparts in that they spent a higher percentage of their time working and continued working longer in inclement weather than did the European bees.<\/p><p><br>These killer bees have been known to attack humans and animals, and some fatalities have occurred. Experts point out, however, that the mixed breed known as the killer bee is actually not at all as aggressive as the pure African bee. <strong>They (B3) <\/strong>also point out that the attacks have a chemical cause. A killer bee stings only when it has been disturbed; it is not aggressive by nature'. However, after a disturbed bee stings and flies away, it leaves its stinger embedded in the victim. In the vicera attached to the embedded stinger is the chemical isoamyl acetate, which has an odor that attracts other bees. As other bees approach the victim of the original sting, the victim tends to panic, thus disturbing other bees and causing them to sting. The new stings create more of the chemical isoamyl acetate, which attracts more bees and increases the panic level of the victim. Killer bees tend to travel in large clusters or swarms and thus respond in large numbers to the production of isoamyl acetate<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T14:10:58.000000Z","sequence_exam":[{"id_exam":181,"sequence":13},{"id_exam":182,"sequence":14},{"id_exam":183,"sequence":15}],"question":[{"id":181,"group_question_id":60,"list_question_id":19,"question":"It can be inferred from the passage that the killer bee","option_1":"traveled from Brazil to Africa in 1955","option_2":"was a predecessor of the African bee","option_3":"was carried from Africa to Brazil in 1955","option_4":"did not exist early in the twentieth century","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":182,"group_question_id":60,"list_question_id":19,"question":"Why were African bees considered beneficial?","option_1":"They produced an unusual type of honey.","option_2":"They spent their time traveling.","option_3":"They were very aggressive.","option_4":"They hid from inclement weather.","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":183,"group_question_id":60,"list_question_id":19,"question":"<p>A \"hybrid\" <strong>(B2)<\/strong> is<\/p>","option_1":"a mixture","option_2":"a relative","option_3":"a predecessor","option_4":"an enemy","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T23:03:26.000000Z"}]},{"id":61,"list_question_id":19,"name":"R2C","description":"Questions 10-19","filename_group":"","question_group":"<p>These stories of killer bees in the news in recent years have attracted a lot of attention as the bees have made their way from South America to North America. Killer bees are reputed to be extremely aggressive in nature, although experts say that their aggression may have been somewhat <strong>inflated (B1)<\/strong>.<\/p><p><br>The killer bee is a <strong>hybrid (B2) <\/strong>\u2013 or combination \u2013 of the very mild European strain of honeybee and the considerably more aggressive African bee, which was created when the African strain was imported into Brazil in 1955. The African bees were brought into Brazil because their aggression was considered an advantage: they were far more productive than their European counterparts in that they spent a higher percentage of their time working and continued working longer in inclement weather than did the European bees.<\/p><p><br>These killer bees have been known to attack humans and animals, and some fatalities have occurred. Experts point out, however, that the mixed breed known as the killer bee is actually not at all as aggressive as the pure African bee. <strong>They (B3) <\/strong>also point out that the attacks have a chemical cause. A killer bee stings only when it has been disturbed; it is not aggressive by nature'. However, after a disturbed bee stings and flies away, it leaves its stinger embedded in the victim. In the vicera attached to the embedded stinger is the chemical isoamyl acetate, which has an odor that attracts other bees. As other bees approach the victim of the original sting, the victim tends to panic, thus disturbing other bees and causing them to sting. The new stings create more of the chemical isoamyl acetate, which attracts more bees and increases the panic level of the victim. Killer bees tend to travel in large clusters or swarms and thus respond in large numbers to the production of isoamyl acetate<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T14:11:21.000000Z","sequence_exam":[{"id_exam":184,"sequence":16},{"id_exam":185,"sequence":17},{"id_exam":186,"sequence":18},{"id_exam":187,"sequence":19}],"question":[{"id":184,"group_question_id":61,"list_question_id":19,"question":"It is stated in the passage that killer bees","option_1":"are more deadly than African bees","option_2":"are less aggressive than African bees","option_3":"never attack animals","option_4":"always attack African bees","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":185,"group_question_id":61,"list_question_id":19,"question":"<p>The pronoun \"They\" <strong>(B3)<\/strong> refers to<\/p>","option_1":"killer bees","option_2":"humans and animals","option_3":"fatalities","option_4":"experts","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T23:04:09.000000Z"},{"id":186,"group_question_id":61,"list_question_id":19,"question":"What is NOT mentioned in the passage as a contributing factor in an attack by killer bees?","option_1":"Panic by the victim","option_2":"An odorous chemical","option_3":"Disturbance of the bees","option_4":"Inclement weather","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":187,"group_question_id":61,"list_question_id":19,"question":"<p><strong>(L1)<\/strong> <i>Killer bees are reputed to be extremely aggressive in nature, although experts say that their aggression may have been somewhat inflated.<\/i><\/p><p><strong>(L2)<\/strong> <i>The killer bee is a hybrid \u2013 or combination \u2013 of the very mild European strain of honeybee and the considerably more aggressive African bee, which was created when the African strain was imported into Brazil in 1955.<\/i><\/p><p><strong>(L3)<\/strong> <i>These killer bees have been known to attack humans and animals, and some fatalities have occurred.<\/i><\/p><p><strong>(L4)<\/strong> <i>Killer bees tend to travel in large clusters or swarms and thus respond in large numbers to the production of isoamyl acetate.<\/i><\/p><p>&nbsp;<\/p><p>Where in the passage does the author describe the size of the groups in which killer bees move?<\/p>","option_1":"L1","option_2":"L2","option_3":"L3","option_4":"L4","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T23:15:42.000000Z"}]},{"id":62,"list_question_id":19,"name":"R3A","description":"Questions 20-28","filename_group":"","question_group":"<p>There is a common expression in the English language referring to a blue moon. When people say that something happens \"only once in a blue moon: they mean that it happens only very rarely, once in a great while. This expression has been around for at least a century and a half; there are references to this expression that date from the second half of the nineteenth century.<\/p><p>The expression \"a blue moon\" has come to refer to the second full moon occurring in any given calendar month. A second full moon is not called a blue moon because it is particularly blue or is any different in <strong>hue (C1) <\/strong>from the first full moon of the month. Instead, it is called a blue moon because it is so rare. The moon needs a little more than 29 days to complete the cycle from full moon to full moon. Because every month except February has more than 29 days, every month will have at least one full moon (except February. which will have a full moon unless there is a full moon at the very end of January and another full moon at the very beginning of March). It is on the occasion when a given calendar month has a second full moon that a blue moon occurs. This does not happen very often, only three or four times in a decade.<\/p><p>The blue moons of today are called blue moons because of their rarity and not because of their color; however. The expression \"blue moon\" may have come into existence in reference to unusual circumstances in which the moon actually appeared blue. Certain natural phenomena of gigantic proportions can actually change the appearance of the moon from Earth. The eruption of the Krakatao volcano in 1883 left dust particles in the atmosphere, which clouded the sun and gave the moon a bluish tint. This particular occurrence of the blue moon may have <strong>given rise to (C2)<\/strong> the expression that we use today. Another example occurred more than a century later. When Mount Pinatub erupted in the Philippines in 1991, the moon again took on a blue tint.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T14:42:26.000000Z","sequence_exam":[{"id_exam":188,"sequence":20},{"id_exam":189,"sequence":21},{"id_exam":190,"sequence":22}],"question":[{"id":188,"group_question_id":62,"list_question_id":19,"question":"This passage is about","option_1":"an idiomatic expression","option_2":"an unusual color","option_3":"a month on the calendar","option_4":"a phase of the moon","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":189,"group_question_id":62,"list_question_id":19,"question":"How long has the expression \"once in a blue moon\" been around?","option_1":"For around 50 years","option_2":"For less than 100 years","option_3":"For more than 100 years","option_4":"For 200 years","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":190,"group_question_id":62,"list_question_id":19,"question":"A blue moon could best be described as","option_1":"a full moon that is not blue in color","option_2":"a new moon that is blue in color","option_3":"a full moon that i