ished in 1839, and his fame and fortune were ensured.<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:41:22.000000Z","sequence_exam":[{"id_exam":175,"sequence":7},{"id_exam":176,"sequence":8},{"id_exam":177,"sequence":9}],"question":[{"id":175,"group_question_id":58,"list_question_id":19,"question":"According to the passage, Audubon's paintings.","option_1":"were realistic portrayals","option_2":"used only black, white. and gray","option_3":"were done in oils","option_4":"depicted birds in cages","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":176,"group_question_id":58,"list_question_id":19,"question":"<p>The word \"support\" <strong>(A4)<\/strong> could best be replaced by<\/p>","option_1":"tolerate","option_2":"provide for","option_3":"side with","option_4":"fight for","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T22:38:30.000000Z"},{"id":177,"group_question_id":58,"list_question_id":19,"question":"It can be inferred from the passage that after 1839 Audubon","option_1":"unsuccessfully tried to develop new businesses","option_2":"continued to be supported by his wife","option_3":"traveled to Europe","option_4":"became wealthy","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"}]},{"id":59,"list_question_id":19,"name":"R2A","description":"Question 10-19","filename_group":"","question_group":"<p>These stories of killer bees in the news in recent years have attracted a lot of attention as the bees have made their way from South America to North America. Killer bees are reputed to be extremely aggressive in nature, although experts say that their aggression may have been somewhat <strong>inflated (B1)<\/strong>.<\/p><p><br>The killer bee is a <strong>hybrid (B2) <\/strong>\u2013 or combination \u2013 of the very mild European strain of honeybee and the considerably more aggressive African bee, which was created when the African strain was imported into Brazil in 1955. The African bees were brought into Brazil because their aggression was considered an advantage: they were far more productive than their European counterparts in that they spent a higher percentage of their time working and continued working longer in inclement weather than did the European bees.<\/p><p><br>These killer bees have been known to attack humans and animals, and some fatalities have occurred. Experts point out, however, that the mixed breed known as the killer bee is actually not at all as aggressive as the pure African bee. <strong>They (B3) <\/strong>also point out that the attacks have a chemical cause. A killer bee stings only when it has been disturbed; it is not aggressive by nature'. However, after a disturbed bee stings and flies away, it leaves its stinger embedded in the victim. In the vicera attached to the embedded stinger is the chemical isoamyl acetate, which has an odor that attracts other bees. As other bees approach the victim of the original sting, the victim tends to panic, thus disturbing other bees and causing them to sting. The new stings create more of the chemical isoamyl acetate, which attracts more bees and increases the panic level of the victim. Killer bees tend to travel in large clusters or swarms and thus respond in large numbers to the production of isoamyl acetate<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T14:10:24.000000Z","sequence_exam":[{"id_exam":178,"sequence":10},{"id_exam":179,"sequence":11},{"id_exam":180,"sequence":12}],"question":[{"id":178,"group_question_id":59,"list_question_id":19,"question":"The subject of the preceding paragraph was most likely","option_1":"ways of producing honey","option_2":"stories in the media about killer bees","option_3":"the chemical nature of killer bee attacks","option_4":"the creation of the killer bee","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated