ccurred late in the month","option_3":"several times a year","option_4":"during the month of February","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":195,"group_question_id":64,"list_question_id":19,"question":"<p>The expression \"given rise to\u201d <strong>(C2)<\/strong> could best be replaced by<\/p>","option_1":"created a need for","option_2":"elevated the level of","option_3":"spurred the creation of","option_4":"brightened the color of","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T23:44:34.000000Z"},{"id":196,"group_question_id":64,"list_question_id":19,"question":"<p><strong>(P1)<\/strong> There is a common expression in the English language referring to a blue moon. When people say that something happens \"only once in a blue moon: they mean that it happens only very rarely, once in a great while.<\/p><p><strong>(P2)<\/strong> The expression \"a blue moon\" has come to refer to the second full moon occurring in any given calendar month.<\/p><p><strong>(P3)<\/strong> The moon needs a little more than 29 days to complete the cycle from full moon to full moon.<\/p><p><strong>(P4)<\/strong> This does not happen very often, only three or four times in a decade.<\/p><p><br>Where in the passage does the author describe the duration of a lunar cycle?<\/p>","option_1":"P1","option_2":"P2","option_3":"P3","option_4":"P4","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T23:48:47.000000Z"}]},{"id":65,"list_question_id":19,"name":"R4A","description":"Questions 29-40","filename_group":"","question_group":"<p>The organization that today is known as the Bank of America did start out in America, but under quite a different name. Italian American A.P. Giannini established this bank on October 17, 1904, in a renovated saloon in San Francisco's Italian community of North Beach under the name Bank of Italy, with immigrants and first-time bank customers comprising the majority of his first customers. During its development, Giannini's bank survived major crises in the form of a natural disaster and a major economic upheaval that not all other banks were able to overcome.<\/p><p>One major test for Giannini's bank occurred on April 18, 1906, when a massive earthquake struck San Francisco, followed by a <strong>raging (D1) <\/strong>fire that destroyed much of the city. Giannini obtained two wagons and teams of horses, filled the wagons with the bank's reserves, mostly in the form of gold, covered the reserves with crates of oranges, and escaped from the <strong>chaos (D2) <\/strong>of the city with his clients' funds protected. In the aftermath of the disaster, Giannini's bank was the first to resume operations. Unable to install the bank in a proper office setting, Giannini opened up shop on the Washington Street Wharf on a makeshift desk created from boards and barrels.<\/p><p>In the period following the 1906 fire, the Bank of Italy continued to prosper and expand. By 1918 there were twenty-four branches of the Bank of Italy, and by 1928 Giannini had acquired numerous other banks, including a Bank of America located in New York City. In 1930 he <strong>consolidated (D3) <\/strong>all the branches of the Bank of Italy, the Bank of America in New York City, and another Bank of America that he had formed in California into the Bank of America National Trust and Savings Association.<\/p><p>A second major crisis for the bank occurred during the Great Depression of the 1930s. Although Giannini had already retired prior to the darkest days of the Depression, he became incensed when his successor began selling off banks during the bad economic times. Giannini resumed leadership of the bank at the age of sixty-two. Under Giannini's leadership, the bank <strong>weathered the storm of (D4)<\/strong> the Depression and subsequently moved into a phase of overseas development.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T14:54:44.000000Z","sequence_exam":[{"id_exam":197,"sequence":29},{"id_exam":198,"sequence":30},{"id_exam":199,"sequence":31}],"question":[{"id":197,"group_question_id":65,"list_question_id":19,"question":"29. According to the passage, Giannini","option_1":"opened the Bank of America in 1904","option_2":"worked in a bank in Italy","option_3":"set up the Bank of America prior to setting up the Bank of Italy","option_4":"later changed the name of the Bank of Italy","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":198,"group_question_id":65,"list_question_id":19,"question":"Where did Giannini open his first bank?","option_1":"In New York City","option_2":"In what used to be a bar","option_3":"On Washington Street Wharf","option_4":"On a makeshift desk","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":199,"group_question_id":65,"list_question_id":19,"question":"According to the passage, which of the following is NOT true about the San Francisco earthquake?","option_1":"It happened in 1906.","option_2":"It occurred in the aftermath of a fire.","option_3":"It caused problems for Giannini's bank.","option_4":"It was a tremendous earthquake.","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"}]},{"id":66,"list_question_id":19,"name":"R4B","description":"Questions 29-40","filename_group":"","question_group":"<p>The organization that today is known as the Bank of America did start out in America, but under quite a different name. Italian American A.P. Giannini established this bank on October 17, 1904, in a renovated saloon in San Francisco's Italian community of North Beach under the name Bank of Italy, with immigrants and first-time bank customers comprising the majority of his first customers. During its development, Giannini's bank survived major crises in the form of a natural