am":202,"sequence":34}],"question":[{"id":200,"group_question_id":66,"list_question_id":19,"question":"<p>The word \"raging\" <strong>(D1)<\/strong> could best be replaced by<\/p>","option_1":"angered","option_2":"localized","option_3":"intense","option_4":"feeble","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:01:01.000000Z"},{"id":201,"group_question_id":66,"list_question_id":19,"question":"It can be inferred from the passage that Giannini used crates of oranges after the earthquake","option_1":"to hide the gold","option_2":"to fill up the wagons","option_3":"to provide nourishment for his customers","option_4":"to protect the gold from the fire","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":202,"group_question_id":66,"list_question_id":19,"question":"<p>The word \"chaos\" <strong>(D2)<\/strong> is closest in meaning to<\/p>","option_1":"legal system","option_2":"extreme heat","option_3":"overdevelopment","option_4":"total confusion","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:01:48.000000Z"}]},{"id":67,"list_question_id":19,"name":"R4C","description":"Questions 29-40","filename_group":"","question_group":"<p>The organization that today is known as the Bank of America did start out in America, but under quite a different name. Italian American A.P. Giannini established this bank on October 17, 1904, in a renovated saloon in San Francisco's Italian community of North Beach under the name Bank of Italy, with immigrants and first-time bank customers comprising the majority of his first customers. During its development, Giannini's bank survived major crises in the form of a natural disaster and a major economic upheaval that not all other banks were able to overcome.<\/p><p>One major test for Giannini's bank occurred on April 18, 1906, when a massive earthquake struck San Francisco, followed by a <strong>raging (D1) <\/strong>fir