 and forces <strong>itself (E5) <\/strong>under a layer of warm and moist air, creating a line of thunderstorms that races forward at speeds of approximately forty miles per hour. A squall line, which can be hundreds of miles long and can contain fifty distinct thunderheads, is a magnificent force of nature with incredible potential for destruction. Within the squall line, often near its southern end, can be found supercells, long-lived rotating storms of exceptional strength that serve as the source of tornadoes.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T15:11:33.000000Z","sequence_exam":[{"id_exam":212,"sequence":44},{"id_exam":213,"sequence":45},{"id_exam":214,"sequence":46}],"question":[{"id":212,"group_question_id":70,"list_question_id":19,"question":"<p>The word \"benign\" <strong>(E2)<\/strong> is closest in meaning to<\/p>","option_1":"harmless","option_2":"beneficial","option_3":"ferocious","option_4":"spectacular","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:12:53.000000Z"},{"id":213,"group_question_id":70,"list_question_id":19,"question":"<p>The expression \"in concert\" <strong>(E3)<\/strong> could best be replaced by<\/p>","option_1":"as a chorus","option_2":"with other musicians","option_3":"as a cluster","option_4":"in a performance","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:13:25.000000Z"},{"id":214,"group_question_id":70,"list_question_id":19,"question":"<p>According to the passage, a \"squall line\" <strong>(E4)<\/strong> is<\/p>","option_1":"a lengthy cold front","option_2":"a serious thunderstorm","option_3":"a line of supercells","option_4":"a string of thunderheads","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:14:14.000000Z"}]},{"id":71,"list_question_id":19,"name":"R5C","description":"Questions 41-50","filename_group":"","question_group":"<p>Thunderstorms, with their jagged bursts of lightning and roaring thunder, are actually one of nature's primary <strong>mechanisms (E1) <\/strong>for transferring heat from the surface of the earth into the atmosphere. A thunderstorm starts when low-lying pockets of warm air from the surface of the earth begin to rise. The pockets of warm air float upward through the air above that is both cooler and heavier. The rising pockets cool as their pressure decreases, and their latent heat is released above the condensation line through the formation of cumulus clouds.<\/p><p>What will happen with these clouds depends on the temperature of the atmosphere. In winter, the air temperature differential between higher and lower altitudes is not extremely great, and the temperature of the rising air mass drops more slowly. During these colder months, the atmosphere, therefore, tends to remain rather stable. In summer, however, when there is a high accumulation of heat near the earth's surface, in direct contrast to the considerably colder air higher up, the temperature differential between higher and lower altitudes is much more pronounced. As warm air rises in this type of environment, the temperature drops much more rapidly than it does in winter; when the temperature drops more than four degrees Fahrenheit per thousand feet of altitude, cumulus clouds aggregate into a single massive cumulonimbus cloud or thunderhead.<\/p><p>In isolation, a single thunderstorm is an impressive but fairly <strong>benign (E2) <\/strong>way for Mother Earth to defuse trapped heat from her surface; thunderstorms, however, can appear <strong>in concert (E3)<\/strong>, and the resulting show, while extremely impressive, can also prove extraordinarily destructive. When there is a large-scale collision between cold air and warm air masses during the summer months, <strong>a squall line (E4)<\/strong>, or series of thunderheads, may develop. It is common for a squall line to begin when an advancing cold front meets up with and forces <strong>itself (E5) <\/strong>under a layer of warm and moist air, creating a line of thunderstorms that races forward at speeds of approximately forty miles per hour. A squall line, which can be hundreds of miles long and can contain fifty distinct thunderheads, is a magnificent force of nature with incredible potential for destruction. Within the squall line, often near its southern end, can be found supercells, long-lived rotating storms of exceptional strength that serve as the source of tornadoes.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T15:11:52.000000Z","sequence_exam":[{"id_exam":215,"sequence":47},{"id_exam":216,"sequence":48},{"id_exam":217,"sequence":49},{"id_exam":218,"sequence":50}],"question":[{"id":215,"group_question_id":71,"list_question_id":19,"question":"<p>The pronoun \"itself' <strong>(E5)<\/strong>1 refers to<\/p>","option_1":"a large-scale collision","option_2":"a squall line","option_3":"an advancing cold front","option_4":"a layer of warm and moist air","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:14:40.000000Z"},{"id":216,"group_question_id":71,"list_question_id":19,"question":"All of the following are mentioned in the passage about supercells EXCEPT that they","option_1":"are of short duration","option_2":"have circling winds","option_3":"have extraordinary power","option_4":"can give birth to tornadoes","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":217,"group_question_id":71,"list_question_id":19,"question":"This reading would most probably be assigned in which of the following courses?","option_1":"Geology","option_2":"Meteorology","option_3":"Marine Biology","option_4":"Chemistry","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":218,"group_question_id":71,"list_question_id":19,"question":"The paragraph following the passage most likely discusses","option_1":"the lightning and thunder associated with thunderstorms","option_2":"various types of cloud formations","option_3":"the forces that contribute to the formation of squall lines","option_4":"the development of tornadoes within Supercells","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"}]}]}}
